INSERT INTO `jupiter_posts` VALUES (3,1,'2018-12-10 12:53:09','2018-12-10 12:53:09','<!-- wp:heading --><h2>Who we are</h2><!-- /wp:heading --><!-- wp:paragraph --><p>Our website address is: http://rangecroquetatmaleny.org.au.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>What personal data we collect and why we collect it</h2><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>Comments</h3><!-- /wp:heading --><!-- wp:paragraph --><p>When visitors leave comments on the site we collect the data shown in the comments form, and also the visitor&#8217;s IP address and browser user agent string to help spam detection.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>An anonymized string created from your email address (also called a hash) may be provided to the Gravatar service to see if you are using it. The Gravatar service privacy policy is available here: https://automattic.com/privacy/. After approval of your comment, your profile picture is visible to the public in the context of your comment.</p><!-- /wp:paragraph --><!-- wp:heading {\"level\":3} --><h3>Media</h3><!-- /wp:heading --><!-- wp:paragraph --><p>If you upload images to the website, you should avoid uploading images with embedded location data (EXIF GPS) included. Visitors to the website can download and extract any location data from images on the website.</p><!-- /wp:paragraph --><!-- wp:heading {\"level\":3} --><h3>Contact forms</h3><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>Cookies</h3><!-- /wp:heading --><!-- wp:paragraph --><p>If you leave a comment on our site you may opt-in to saving your name, email address and website in cookies. These are for your convenience so that you do not have to fill in your details again when you leave another comment. These cookies will last for one year.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>If you have an account and you log in to this site, we will set a temporary cookie to determine if your browser accepts cookies. This cookie contains no personal data and is discarded when you close your browser.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>When you log in, we will also set up several cookies to save your login information and your screen display choices. Login cookies last for two days, and screen options cookies last for a year. If you select &quot;Remember Me&quot;, your login will persist for two weeks. If you log out of your account, the login cookies will be removed.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>If you edit or publish an article, an additional cookie will be saved in your browser. This cookie includes no personal data and simply indicates the post ID of the article you just edited. It expires after 1 day.</p><!-- /wp:paragraph --><!-- wp:heading {\"level\":3} --><h3>Embedded content from other websites</h3><!-- /wp:heading --><!-- wp:paragraph --><p>Articles on this site may include embedded content (e.g. videos, images, articles, etc.). Embedded content from other websites behaves in the exact same way as if the visitor has visited the other website.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>These websites may collect data about you, use cookies, embed additional third-party tracking, and monitor your interaction with that embedded content, including tracking your interaction with the embedded content if you have an account and are logged in to that website.</p><!-- /wp:paragraph --><!-- wp:heading {\"level\":3} --><h3>Analytics</h3><!-- /wp:heading --><!-- wp:heading --><h2>Who we share your data with</h2><!-- /wp:heading --><!-- wp:heading --><h2>How long we retain your data</h2><!-- /wp:heading --><!-- wp:paragraph --><p>If you leave a comment, the comment and its metadata are retained indefinitely. This is so we can recognize and approve any follow-up comments automatically instead of holding them in a moderation queue.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>For users that register on our website (if any), we also store the personal information they provide in their user profile. All users can see, edit, or delete their personal information at any time (except they cannot change their username). Website administrators can also see and edit that information.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>What rights you have over your data</h2><!-- /wp:heading --><!-- wp:paragraph --><p>If you have an account on this site, or have left comments, you can request to receive an exported file of the personal data we hold about you, including any data you have provided to us. You can also request that we erase any personal data we hold about you. This does not include any data we are obliged to keep for administrative, legal, or security purposes.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Where we send your data</h2><!-- /wp:heading --><!-- wp:paragraph --><p>Visitor comments may be checked through an automated spam detection service.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Your contact information</h2><!-- /wp:heading --><!-- wp:heading --><h2>Additional information</h2><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>How we protect your data</h3><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>What data breach procedures we have in place</h3><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>What third parties we receive data from</h3><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>What automated decision making and/or profiling we do with user data</h3><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>Industry regulatory disclosure requirements</h3><!-- /wp:heading -->','Privacy Policy','','draft','closed','open','','privacy-policy','','','2018-12-10 12:53:09','2018-12-10 12:53:09','',0,'http://rangecroquetatmaleny.org.au/?page_id=3',0,'page','',0),(6,1,'2018-12-10 22:09:38','2018-12-10 22:09:38','','Home','','publish','closed','closed','','home','','','2018-12-22 13:20:11','2018-12-22 13:20:11','',0,'http://rangecroquetatmaleny.org.au/2018/12/10/home/',1,'nav_menu_item','',0),(10,1,'2018-12-12 13:28:30','2018-12-12 13:28:30','','lawn','Play at the Range Croquet Club','inherit','open','closed','','lawn','','','2018-12-12 21:46:07','2018-12-12 21:46:07','',2,'http://rangecroquetatmaleny.org.au/wp-content/uploads/2018/12/lawn.jpg',0,'attachment','image/jpeg',0),(179,1,'2018-12-15 22:10:39','2018-12-15 22:10:39','','About Us','','publish','closed','closed','','about-us','','','2019-01-16 02:09:31','2019-01-16 02:09:31','',0,'http://rangecroquetatmaleny.org.au/?page_id=179',0,'page','',0),(180,1,'2018-12-15 22:10:39','2018-12-15 22:10:39',' ','','','publish','closed','closed','','180','','','2018-12-22 13:20:11','2018-12-22 13:20:11','',0,'http://rangecroquetatmaleny.org.au/2018/12/15/180/',16,'nav_menu_item','',0),(181,1,'2018-12-15 22:10:40','2018-12-15 22:10:40',' ','','','publish','closed','closed','','181','','','2019-01-16 04:48:01','2019-01-16 04:48:01','',0,'http://rangecroquetatmaleny.org.au/2018/12/15/181/',6,'nav_menu_item','',0),(183,1,'2018-12-15 22:21:06','2018-12-15 22:21:06','<!-- wp:paragraph -->\n<p>Our courts may be available for community use or for special events, like workplace team-building or social gathering (no alcohol). Our croquet equipment may be available for your guests in some special occasion (e.g. wedding) if suitable grounds are available. If you are interested, please phone, email or use the contact page.</p>\n<!-- /wp:paragraph -->','Court Hire','','publish','closed','closed','','court-hire','','','2018-12-15 22:22:10','2018-12-15 22:22:10','',179,'http://rangecroquetatmaleny.org.au/?page_id=183',0,'page','',0),(45,1,'2018-12-13 00:46:50','2018-12-13 00:46:50',' ','','','publish','closed','closed','','45','','','2018-12-22 13:20:11','2018-12-22 13:20:11','',0,'http://rangecroquetatmaleny.org.au/?p=45',2,'nav_menu_item','',0),(46,1,'2018-12-13 00:52:46','2018-12-13 00:52:46','<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>We play <a href=\"http://rangecroquetatmaleny.org.au/what-we-play/association-croquet/\">Association Croquet</a> on club days and our coaching is geared towards this. We have a team entering the local Sunshine Coast pennants competition in both the the Lockwood and Bray competitions.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>In addition informal games of <a href=\"http://rangecroquetatmaleny.org.au/what-we-play/golf-croquet/\">Golf Croquet</a> are also played.</p>\n<!-- /wp:paragraph -->','What we play','','publish','closed','closed','','what-we-play','','','2018-12-14 04:30:38','2018-12-14 04:30:38','',0,'http://rangecroquetatmaleny.org.au/?page_id=46',3,'page','',0),(47,1,'2018-12-13 00:52:46','2018-12-13 00:52:46',' ','','','publish','closed','closed','','47','','','2018-12-22 13:20:11','2018-12-22 13:20:11','',0,'http://rangecroquetatmaleny.org.au/2018/12/13/47/',3,'nav_menu_item','',0),(58,1,'2018-12-13 08:18:31','2018-12-13 08:18:31','<!-- wp:paragraph -->\n<p>Golf Croquet is the simplest form of Croquet to learn and play and is a very sociable game. It is the form we introduce during our Corporate &amp; Social Group Days, as players can immediately begin to learn skills, whilst at the same time having a lot of fun.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Points are scored by running your ball through a hoop, with your mallet. Usually players play in pairs, one pair with the blue and black balls and the other pair with the red and yellow balls. The first ball to run a hoop, wins that hoop. After running six hoops in a clockwise direction, hoops are then run in an anti-clockwise direction, until one pair scores seven hoops and is declared the winner of that game.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>There are several tactical moves to master, so as to ensure that your balls run the hoop before those of your opponents. Newcomers to the game derive much pleasure from the perceived ‘meanness’ of some of these tactics.</p>\n<!-- /wp:paragraph -->','Golf Croquet','','publish','closed','closed','','golf-croquet','','','2018-12-13 08:18:31','2018-12-13 08:18:31','',46,'http://rangecroquetatmaleny.org.au/?page_id=58',0,'page','',0),(53,1,'2018-12-13 01:00:44','2018-12-13 01:00:44','<!-- wp:paragraph -->\n<p>Association Croquet is a tactical game, usually between two players, consisting of running six hoops in order with two balls, clockwise first and then anti-clockwise, and finally hitting the central peg.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>It is played in a lawn measuring 35yd by 28 yards. The running of a hoop and hitting of the peg scores one point. The maximum score is, therefore, 26 points. Six hoops twice by two balls plus the pegging out.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Running a hoop and hitting another ball (roquet) entitles the player to play extra shots. One of them is the croquet shot, unique to this game, when the striker ball is hit when touching another ball. Like chess, by a simple set-up and by this entitlement of extra shots a complex tactical game develops, which is the main attraction of the game.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>The ball weighs 1 lb and the hoops just allow the ball to run through them. The balls are hit with a mallet, that weighs usually about 3 lb.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Croquet is a fascinating game of tactics especially appealing to people interested in intellectual challenges. It can be played at any age. Most croquet players regret not having taken up the game at an early stage of their lives.</p>\n<!-- /wp:paragraph -->','Association Croquet','','publish','closed','closed','','association-croquet','','','2018-12-13 01:00:44','2018-12-13 01:00:44','',46,'http://rangecroquetatmaleny.org.au/?page_id=53',0,'page','',0),(55,1,'2018-12-13 01:01:56','2018-12-13 01:01:56',' ','','','publish','closed','closed','','55','','','2018-12-22 13:20:11','2018-12-22 13:20:11','',46,'http://rangecroquetatmaleny.org.au/?p=55',4,'nav_menu_item','',0),(60,1,'2018-12-13 08:19:09','2018-12-13 08:19:09',' ','','','publish','closed','closed','','60','','','2018-12-22 13:20:11','2018-12-22 13:20:11','',46,'http://rangecroquetatmaleny.org.au/?p=60',5,'nav_menu_item','',0),(379,1,'2019-01-22 03:55:55','2019-01-22 03:55:55','','rangenews','Newspaper article ','inherit','open','closed','','rangenews','','','2019-01-22 03:59:48','2019-01-22 03:59:48','',74,'http://rangecroquetatmaleny.org.au/wp-content/uploads/2019/01/rangenews.jpg',0,'attachment','image/jpeg',0),(240,1,'2019-01-03 09:02:25','2019-01-03 09:02:25','','churchbookscatalogue','','inherit','open','closed','','churchbookscatalogue','','','2019-01-03 09:02:25','2019-01-03 09:02:25','',0,'http://rangecroquetatmaleny.org.au/wp-content/uploads/2019/01/churchbookscatalogue.pdf',0,'attachment','application/pdf',0),(184,1,'2018-12-15 22:21:06','2018-12-15 22:21:06',' ','','','publish','closed','closed','','184','','','2018-12-22 13:20:11','2018-12-22 13:20:11','',179,'http://rangecroquetatmaleny.org.au/2018/12/15/184/',17,'nav_menu_item','',0),(185,1,'2018-12-15 22:21:06','2018-12-15 22:21:06',' ','','','publish','closed','closed','','185','','','2019-01-16 04:48:01','2019-01-16 04:48:01','',179,'http://rangecroquetatmaleny.org.au/2018/12/15/185/',8,'nav_menu_item','',0),(71,1,'2018-12-13 12:26:55','2018-12-13 12:26:55','<!-- wp:paragraph -->\n<p><a href=\"https://www.croquetqld.org/\">Croquet Queensland</a></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><a href=\"http://www.croquet-australia.com.au\">Croquet Australia</a></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><a href=\"https://malenysportandrec.org.au/\">Maleny District Sport and Recreation Club</a></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>This video describes some of the tactics used in Association Croquet:&nbsp;<a href=\"https://www.youtube.com/watch?v=AgH4gxNp_7w\">An Introduction to Association Croquet 2017</a></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>This website contains a huge amount of information for croquet players at any level:&nbsp;<br><a href=\"http://oxfordcroquet.com/coach/index.asp\">Oxford Croquet How to Play Croquet Dr Ian Plummer</a></p>\n<!-- /wp:paragraph -->','Useful Links','','publish','closed','closed','','useful-links','','','2019-02-04 21:13:42','2019-02-04 11:13:42','',46,'http://rangecroquetatmaleny.org.au/?page_id=71',0,'page','',0),(72,1,'2018-12-13 12:26:55','2018-12-13 12:26:55',' ','','','publish','closed','closed','','72','','','2018-12-22 13:20:11','2018-12-22 13:20:11','',0,'http://rangecroquetatmaleny.org.au/2018/12/13/72/',7,'nav_menu_item','',0),(74,1,'2018-12-13 12:29:19','2018-12-13 12:29:19','<!-- wp:paragraph -->\n<p> A few people got together in the late 1980’s and started to play croquet on the lawn at the house of one of them on Mountain View Road. In 1991 they formed the Croquet Club with Ted Singleton as the president. A piece of ground became available for their use at the Maleny Showgrounds and in December 1992 the area was prepared and ready for the turf. The work was all done by the members and teachers from the Maleny School where Ted Singleton was working. Fortunately they were mostly quite young and able bodied.<br></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:image {\"id\":379} -->\n<figure class=\"wp-block-image\"><img src=\"http://rangecroquetatmaleny.org.au/wp-content/uploads/2019/01/rangenews-993x1024.jpg\" alt=\"Newspaper article describing opening of the Range Croquet Club\" class=\"wp-image-379\"/><figcaption>Newspaper article describing club opening</figcaption></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p>A few years later the ground adjacent to the first lawn became available and some of the the same people, with the assistance of the Apex Club, worked to make a second lawn which was opened on the 15th May 1997. In that year Vince Carbery became the president and still holds that position.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:image {\"id\":384} -->\n<figure class=\"wp-block-image\"><img src=\"http://rangecroquetatmaleny.org.au/wp-content/uploads/2019/01/lawns-2008-1024x627.jpg\" alt=\"\" class=\"wp-image-384\"/><figcaption>A view of the two lawns ten years after they were established</figcaption></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p>Since then, many games have been played on the lawns. The club members have entered and been successful in Sunshine Coast pennant competitions, Queensland wide completions and the club has organised and hosted numerous tournaments. In 2005, the club, in association with other Sunshine Coast clubs, hosted the Australian championship.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:image {\"id\":385} -->\n<figure class=\"wp-block-image\"><img src=\"http://rangecroquetatmaleny.org.au/wp-content/uploads/2019/01/australianchampionships2005a-1024x770.jpg\" alt=\"\" class=\"wp-image-385\"/><figcaption>Action on the lawns at the Australian Championships, 2005 (Bob Beattie from Tasmania)</figcaption></figure>\n<!-- /wp:image -->','History','','publish','closed','closed','','history','','','2019-01-22 04:31:09','2019-01-22 04:31:09','',179,'http://rangecroquetatmaleny.org.au/?page_id=74',0,'page','',0),(75,1,'2018-12-13 12:29:19','2018-12-13 12:29:19',' ','','','publish','closed','closed','','75','','','2018-12-22 13:20:11','2018-12-22 13:20:11','',179,'http://rangecroquetatmaleny.org.au/2018/12/13/75/',6,'nav_menu_item','',0),(158,1,'2018-12-15 13:22:40','2018-12-15 13:22:40',' ','','','publish','closed','closed','','158','','','2018-12-22 13:20:11','2018-12-22 13:20:11','',102,'http://rangecroquetatmaleny.org.au/2018/12/15/158/',12,'nav_menu_item','',0),(87,1,'2018-12-14 03:43:51','2018-12-14 03:43:51','<label> Your Name (required)\n    [text* your-name] </label>\n\n<label> Your Email (required)\n    [email* your-email] </label>\n\n<label> Subject\n    [text your-subject] </label>\n\n<label> Your 