1','2019-02-06 07:06:01','',0,'http://rangecroquetatmaleny.org.au/?p=308',18,'nav_menu_item','',0),(439,1,'2019-02-10 18:35:21','0000-00-00 00:00:00','','Auto Draft','','auto-draft','open','closed','','','','','2019-02-10 18:35:21','0000-00-00 00:00:00','',0,'http://rangecroquetatmaleny.org.au/?p=439',0,'post','',0),(407,1,'2019-01-31 20:21:25','2019-01-31 10:21:25','<!-- wp:paragraph -->\n<p>Whether you are thinking of taking up a new sport or an experienced croquet player, you are invited to visit the Range Croquet Club. Our club is located in the Maleny Showground close to the centre of Maleny. Maleny is in the Sunshine Coast Hinterland about 90 kilometres north Of Brisbane.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Our small friendly Club consists of about 20 members of all ages, men and women, ranging from beginners to players of high standard. New members are always welcome. We are affiliated with <a href=\"http://croquetqld.org\">Croquet Queensland</a>.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>We have two excellent full size grass courts in an attractive location.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Tuition is available from qualified instructors on most Saturday mornings from 8 AM. Non-members may join may attend six sessions for $20 before whether or not to join the club. The sessions continue to be available to members.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Association Croquet and Golf croquet is played on Thursday and Sunday afternoons. Start time is 1:30 PM from April to September and 2:30 PM otherwise. Visitors are always welcome. Members may use the courts for play or practice at other times.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>There are no lawn fees for members and visitors pay $5 per session. Annual membership (which falls due in October is&nbsp; $260, pro rata if you join during the year.</p>\n<!-- /wp:paragraph -->','Join Us','','inherit','closed','closed','','343-revision-v1','','','2019-01-31 20:21:25','2019-01-31 10:21:25','',343,'http://rangecroquetatmaleny.org.au/uncategorized/343-revision-v1/',0,'revision','',0),(325,1,'2019-01-16 07:16:59','2019-01-16 07:16:59','','Member Information','','publish','closed','closed','','member-information','','','2019-01-16 07:16:59','2019-01-16 07:16:59','',0,'http://rangecroquetatmaleny.org.au/?page_id=325',0,'page','',0),(326,1,'2019-01-16 07:16:59','2019-01-16 07:16:59',' ','','','publish','closed','closed','','326','','','2019-01-16 07:16:59','2019-01-16 07:16:59','',0,'http://rangecroquetatmaleny.org.au/2019/01/16/326/',26,'nav_menu_item','',0),(328,1,'2019-01-16 07:18:38','2019-01-16 07:18:38',' ','','','publish','closed','closed','','328','','','2019-02-06 17:06:01','2019-02-06 07:06:01','',0,'http://rangecroquetatmaleny.org.au/?p=328',15,'nav_menu_item','',0),(332,1,'2019-01-16 07:28:52','2019-01-16 07:28:52','<!-- wp:shortcode -->\n[bsk-pdfm-pdfs-ul id=\"5\"]\n<!-- /wp:shortcode -->','Weekly Newsletter','','publish','closed','closed','','weekly-newsletter','','','2019-01-16 07:46:37','2019-01-16 07:46:37','',127,'http://rangecroquetatmaleny.org.au/?page_id=332',0,'page','',0),(331,1,'2019-01-16 07:27:02','2019-01-16 07:27:02',' ','','','publish','closed','closed','','331','','','2019-02-06 17:06:01','2019-02-06 07:06:01','',325,'http://rangecroquetatmaleny.org.au/?p=331',17,'nav_menu_item','',0),(340,1,'2019-01-16 11:51:30','2019-01-16 11:51:30','<!-- wp:shortcode -->\n[events_calendar]\n<!-- /wp:shortcode -->','Calendar','','publish','closed','closed','','calendar','','','2019-01-16 11:51:30','2019-01-16 11:51:30','',0,'http://rangecroquetatmaleny.org.au/?page_id=340',0,'page','',0),(341,1,'2019-01-16 11:51:30','2019-01-16 11:51:30',' ','','','publish','closed','closed','','341','','','2019-01-16 11:51:30','2019-01-16 11:51:30','',0,'http://rangecroquetatmaleny.org.au/2019/01/16/341/',26,'nav_menu_item','',0),(343,1,'2019-01-16 22:10:50','2019-01-16 22:10:50','<!-- wp:paragraph -->\n<p>Whether you are thinking of taking up a new sport or an experienced croquet player, you are invited to visit the Range Croquet Club. Our club is located in the Maleny Showground close to the centre of Maleny. Maleny is in the Sunshine Coast Hinterland about 90 kilometres north Of Brisbane.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Our small friendly Club consists of about 20 members of all ages, men and women, ranging from beginners to players of high standard. New members are always welcome. We are affiliated with <a href=\"http://croquetqld.org\">Croquet Queensland</a>.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>We have two excellent full size grass courts in an attractive location.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Tuition is available from qualified instructors on most Saturday mornings from 8 AM. Non-members may join may attend six sessions for $20 before whether or not to join the club. The sessions continue to be available to members.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Association Croquet and Golf croquet is played on Thursday and Sunday afternoons. Start time is 1:30 PM from April to September and 2:30 PM otherwise. Visitors are always welcome. Members may use the courts for play or practice at other times.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>There are no lawn fees for members and visitors pay $5 per session. Annual membership (which falls due in October is&nbsp; $260, pro rata if you join during the year.</p>\n<!-- /wp:paragraph -->','Join Us','','publish','closed','closed','','join-us','','','2019-01-31 20:21:25','2019-01-31 10:21:25','',0,'http://rangecroquetatmaleny.org.au/?page_id=343',0,'page','',0),(344,1,'2019-01-16 22:10:50','2019-01-16 22:10:50',' ','','','publish','closed','closed','','344','','','2019-01-16 22:10:50','2019-01-16 22:10:50','',0,'http://rangecroquetatmaleny.org.au/2019/01/16/344/',27,'nav_menu_item','',0),(405,1,'2019-01