'2019-02-10 18:46:40','2019-02-10 08:46:40','',231,'http://rangecroquetatmaleny.org.au/uncategorized/231-revision-v1/',0,'revision','',0),(413,1,'2019-02-02 08:43:46','2019-02-01 22:43:46','<!-- wp:shortcode -->\n[awl-slider id=391]\n<!-- /wp:shortcode -->\n\n<!-- wp:heading -->\n<h2>OPEN DAY SATURDAY 9 FEBRUARY <br>8AM TO 10AM</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Are you interested in a free introduction to the game of croquet? Come along and we will be happy to introduce you to the art of croquet. Meet our members for a cup of tea.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Bring sunscreen, hat and closed in shoes (as croquet balls can hurt ankles). The club will provide everything else. </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>If you have any enquiries, please phone Vince on 54942193.</p>\n<!-- /wp:paragraph -->','Welcome','','inherit','closed','closed','','231-revision-v1','','','2019-02-02 08:43:46','2019-02-01 22:43:46','',231,'http://rangecroquetatmaleny.org.au/uncategorized/231-revision-v1/',0,'revision','',0),(412,1,'2019-02-02 08:41:07','2019-02-01 22:41:07','<!-- wp:shortcode -->\n[awl-slider id=391]\n<!-- /wp:shortcode -->\n\n<!-- wp:heading -->\n<h2>OPEN DAY SATURDAY 9 FEBRUARY <br>8AM TO 10AM</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Are you interested in a free introduction to the game of croquet? Come along and we will be happy to introduce you to the art of croquet. Meet our members for a cup of tea.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Bring sunscreen, hat and closed in shoes (as croquet balls can hurt ankles). The club will provide everything else. </p>\n<!-- /wp:paragraph -->','Welcome','','inherit','closed','closed','','231-revision-v1','','','2019-02-02 08:41:07','2019-02-01 22:41:07','',231,'http://rangecroquetatmaleny.org.au/uncategorized/231-revision-v1/',0,'revision','',0),(410,1,'2019-02-02 08:34:52','2019-02-01 22:34:52','<!-- wp:shortcode -->\n[awl-slider